import { NavLink } from "react-router-dom";

export default function NavAdmin() {
    function handleSignOut() {
        localStorage.removeItem("isAuth"); // reset localStorage
    }

    return (
        <nav>
            <NavLink onClick={handleSignOut}>Sign Out</NavLink>
        </nav>
    );
}
